function PageFavs() {
    return (
        <div>
            <section className="favs-page">
            <h2>Favourite Page</h2>
            </section>

            <section>
                <p>You don't have any favourite movie yet.</p>
                <p>Return to the <NavLink to='/' exact>Movies</NavLink></p>
            </section>
        </div>
    )
}

